import styled from "styled-components";
import {
  bgColour,
  fontColour,
  primaryColour,
  secondaryColour,
  accentColour,
  linkColour,
} from "../colours";

const Heading = styled.h1`
  font-family: "Josefin Sans", sans-serif;
  color: ${fontColour};
`;

export { Heading };
